": "v0.11.0","description": null,"creator": {"login": "Startrekzky","id": 14050754,"node_id": "MDQ6VXNlcjE0MDUwNzU0","avatar_url": "https://avatars.githubusercontent.com/u/14050754?v=4","gravatar_id": "","url": "https://api.github.com/users/Startrekzky","html_url": "https://github.com/Startrekzky","followers_url": "https://api.github.com/users/Startrekzky/followers","following_url": "https://api.github.com/users/Startrekzky/following{/other_user}","gists_url": "https://api.github.com/users/Startrekzky/gists{/gist_id}","starred_url": "https://api.github.com/users/Startrekzky/starred{/owner}{/repo}","subscriptions_url": "https://api.github.com/users/Startrekzky/subscriptions","organizations_url": "https://api.github.com/users/Startrekzky/orgs","repos_url": "https://api.github.com/users/Startrekzky/repos","events_url": "https://api.github.com/users/Startrekzky/events{/privacy}","received_events_url": "https://api.github.com/users/Startrekzky/received_events","type": "User","site_admin": false},"open_issues": 2,"closed_issues": 118,"state": "open","created_at": "2022-04-08T02:05:35Z","updated_at": "2022-06-24T01:34:37Z","due_on": null,"closed_at": null},"comments":2,"created_at":"2018-11-18T08:50:31Z","updated_at":"2019-01-29T07:24:37Z","closed_at":"2019-01-29T07:24:37Z","author_association":"NONE","active_lock_reason":null,"body":"关于这个package优雅退出的问题，我看了一下Release的代码：

`
	// Release Closed this pool.
	func (p *PoolWithFunc) Release() error {
		p.once.Do(func() {
			p.release <- sig{}
			p.lock.Lock()
			idleWorkers := p.workers
			for i, w := range idleWorkers {
				w.args <- nil
				idleWorkers[i] = nil
			}
			p.workers = nil
			p.lock.Unlock()
		})
		return nil
	}
`

release中，好像没有去等待那些已经正在工作的worker处理完它们的工作？
仅仅是回收了空闲的worker

那么在收到程序退出的信号时候，release是不能确保正在工作的worker能妥善完成工作

如果想实现比较好退出方式目前好像是：

ReSize(0) 

不知道我理解的对不对？
