{"url":"https://api.github.com/repos/panjf2000/ants/issues/38","repository_url":"https://api.github.com/repos/panjf2000/ants","labels_url":"https://api.github.com/repos/panjf2000/ants/issues/38/labels{/name}","comments_url":"https://api.github.com/repos/panjf2000/ants/issues/38/comments","events_url":"https://api.github.com/repos/panjf2000/ants/issues/38/events","html_url":"https://github.com/panjf2000/ants/issues/38","id":472125082,"node_id":"MDU6SXNzdWU0NzIxMjUwODI=","number":38,"title":"retrieveWorker与revertWorker之间会导致死锁","user":{"login":"wwjiang","id":1290360,"node_id":"MDQ6VXNlcjEyOTAzNjA=","avatar_url":"https://avatars.githubusercontent.com/u/1290360?v=4","gravatar_id":"","url":"https://api.github.com/users/wwjiang","html_url":"https://github.com/wwjiang","followers_url":"https://api.github.com/users/wwjiang/followers","following_url":"https://api.github.com/users/wwjiang/following{/other_user}","gists_url":"https://api.github.com/users/wwjiang/gists{/gist_id}","starred_url":"https://api.github.com/users/wwjiang/starred{/owner}{/repo}","subscriptions_url":"https://api.github.com/users/wwjiang/subscriptions","organizations_url":"https://api.github.com/users/wwjiang/orgs","repos_url":"https://api.github.com/users/wwjiang/repos","events_url":"https://api.github.com/users/wwjiang/events{/privacy}","received_events_url":"https://api.github.com/users/wwjiang/received_events","type":"User","site_admin":false},"labels":[],"state":"closed","locked":false,"assignee":null,"assignees":[],"milestone":{"url": "https://api.github.com/repos/apache/incubator-devlake/milestones/7","html_url": "https://github.com/apache/incubator-devlake/milestone/7","labels_url": "https://api.github.com/repos/apache/incubator-devlake/milestones/7/labels","id": 7856149,"node_id": "MI_kwDOFuUSzs4Ad-AV","number": 7,"title": "v0.11.0","description": null,"creator": {"login": "Startrekzky","id": 14050754,"node_id": "MDQ6VXNlcjE0MDUwNzU0","avatar_url": "https://avatars.githubusercontent.com/u/14050754?v=4","gravatar_id": "","url": "https://api.github.com/users/Startrekzky","html_url": "https://github.com/Startrekzky","followers_url": "https://api.github.com/users/Startrekzky/followers","following_url": "https://api.github.com/users/Startrekzky/following{/other_user}","gists_url": "https://api.github.com/users/Startrekzky/gists{/gist_id}","starred_url": "https://api.github.com/users/Startrekzky/starred{/owner}{/repo}","subscriptions_url": "https://api.github.com/users/Startrekzky/subscriptions","organizations_url": "https://api.github.com/users/Startrekzky/orgs","repos_url": "https://api.github.com/users/Startrekzky/repos","events_url": "https://api.github.com/users/Startrekzky/events{/privacy}","received_events_url": "https://api.github.com/users/Startrekzky/received_events","type": "User","site_admin": false},"open_issues": 2,"closed_issues": 118,"state": "open","created_at": "2022-04-08T02:05:35Z","updated_at": "2022-06-24T01:34:37Z","due_on": null,"closed_at": null},"comments":0,"created_at":"2019-07-24T07:32:58Z","updated_at":"2019-07-24T08:40:01Z","closed_at":"2019-07-24T08:40:01Z","author_association":"NONE","active_lock_reason":null,"body":"func (p *Pool) retrieveWorker() *Worker {
	var w *Worker

	**p.lock.Lock()**
	idleWorkers := p.workers
	n := len(idleWorkers) - 1
	if n >= 0 {
		w = idleWorkers[n]
		idleWorkers[n] = nil
		p.workers = idleWorkers[:n]
		p.lock.Unlock()
	} else if p.Running() < p.Cap() {
		p.lock.Unlock()
		if cacheWorker := p.workerCache.Get(); cacheWorker != nil {
			w = cacheWorker.(*Worker)
		} else {
			w = &Worker{
				pool: p,
				task: make(chan func(), workerChanCap),
			}
		}
		w.run()
	} else {
		for {
			**p.cond.Wait()** 
			l := len(p.workers) - 1
			if l < 0 {
				continue
			}
			w = p.workers[l]
			p.workers[l] = nil
			p.workers = p.workers[:l]
			break
		}
		**p.lock.Unlock()**
	}
	return w
}

// revertWorker puts a worker back into free pool, recycling the goroutines.
func (p *Pool) revertWorker(worker *Worker) bool {
	if CLOSED == atomic.LoadInt32(&p.release) {
		return false
	}
	worker.recycleTime = time.Now()
	**p.lock.Lock()** // 协程池满了之后获取不到锁
	p.workers = append(p.workers, worker)
	// Notify the invoker stuck in 'retrieveWorker()' of there is an available worker in the worker queue.
	p.cond.Signal()
	**p.lock.Unlock()**
	return true
}
